// Dependencies.
import React from 'react';

// Component 'DiveDeep'.
function DiveDeep() {
    return (
        // DiveDeep Container.
        <div className="container-fluid text-center">
            <img className="img-thumgnail" alt="iamshawn.jpg" src="../../assets/misc/iamshawn.jpg" />
        </div>
    );
}

// Do export.
export default DiveDeep;
